import Footer from "../Componenets/Footer";
import Navbar from "../Componenets/Navbar";

const About = () => {
  return (
    <>
      <Navbar />
      <section class="jumbo-main">
      <div class="container">
        <div class="row">
          <div class="col-6 jumbo-content">
            <h1>About <Us></Us></h1>
            <p></p>
          </div>
        </div>
      </div>
    </section>
    <Footer />
    </>
  );
};
export default About;
